		function cancelPause() { //ביטול השהייה
			stage.getChildByName("pause_btn").visible = true; //החזרת כפתור פאוז
			stage.removeChild(stage.getChildByName("coffeeBreak")); //הסרת רקע
			stage.removeChild(stage.getChildByName("continue_btn")); //הסרת כפתור
		
			if (stage.getChildByName("nextBtn") == null) { //אם כפתור המשך לא קיים על הבמה כלומר לא נבדקה כבר תשובה
				timer = setInterval(myinterval, 1000); //הפעלת הטיימר
			}
		}
		
		function randFunc() { //פונקציית הגרלת שאלה
			qCounter = Math.floor(Math.random() * myGame.length); //הגרלת מספר שאלה
			if (myGame.length > 1) { //במידה ולא נשארה רק שאלה אחת במאגר
				if (prevQ != null) { //אם עדיין לא הוגרלה שאלה לפני
					if (prevQ == qCounter) { // אם המספר שהוגרל שווה למספר השאלה הקודמת תקרא לפונקציה שוב ותגריל פעם נוספת
						randFunc();
					}
				}
			}
		}
		
		function rndDistractor() {//הגרלת מסיחים
		
			rnd_ans = Math.ceil(Math.random() * (myGame[qCounter].length - 1));
			
			if (myGame[qCounter][rnd_ans][3] == "not added") {
				myGame[qCounter][rnd_ans][3] = "added";
			} else {//אם מסיח כבר הוגרל תהיה הגרלה נוספת
		
				rndDistractor();
			}
		}
		
		function clickAnswer(event) { //------------לחיצה על מסיח----------	
		
			//יצירת כפתור בדוק
			var checkBtn = new lib.btn();
			//מיקום באמצע הבמה
			checkBtn.x = stageW / 2 + 20;
			checkBtn.y = 530;
			checkBtn.name = "checkBtn";
			checkBtn.btnTxt.text = "בדוק";
			stage.addChild(checkBtn);
			checkBtn.cursor = "pointer"; ///הוספת שינוי העכבר
			checkBtn.addEventListener("click", checkFunc); //קישור לפונקציה	
		
			//מסגרת סימון מסיח
			for (i = 1; i < myGame[qCounter].length; i++) { //איפוס כל המסיחים ללא מסגרת צהובה
				stage.getChildByName("dis" + i).gotoAndStop(0);
			}
			event.currentTarget.gotoAndStop(1); //שינוי מסגרת המסיח הנבחר לצהובה
		
			currentClick = parseInt(event.currentTarget.name.charAt(3)); //שמירת אינדקס המסיח הנבחר	
			//console.log(currentClick);
		}
		
		function checkFunc() { //----------מופעלת בלחיצה על כפתור בדוק---------
		
			stage.removeChild(stage.getChildByName("checkBtn")); //הסרת כפתור הבדוק
		
			//יצירת כפתור המשך
			var nextBtn = new lib.btn();
			//מיקום באמצע הבמה
			nextBtn.x = stageW / 2 + 20;
			nextBtn.y = 530;
			nextBtn.name = "nextBtn";
			nextBtn.cursor = "pointer"; ///הוספת שינוי העכבר
			nextBtn.btnTxt.text = "המשך";
			stage.addChild(nextBtn);
			nextBtn.addEventListener('click', clean); //קישור לפונקציה שמנקה את המסך
		
			//--------------------------אם התשובה נכונה--------------------
		
			if ((myGame[qCounter][currentClick][1]) == true) {
				stage.getChildByName("dis" + currentClick).gotoAndStop(2); //מעבר לפריים המציג מסגרת ירוקה למסיח
				correctAnsNum++; //העלת מספר השאלות שנענו נכון (יוצג על המד)
				stage.getChildByName("scaleBack").tempTxt.text = correctAnsNum + "/" + Qamount;
		
				var tempScale = stage.getChildByName("tempScale");
				if (player == "left") { //אם היה תור השחקן השמאלי
		
					stage.getChildByName("group_left").gotoAndPlay(2); //הפעלת אנימציה של הצלחה
					backMusic = createjs.Sound.play("yaySound");
					tempScale.scaleY += 1 / Qamount; //עלייה של המד
					//הוספה של משפט משוב הצלחה בבועת דיבור
					var buble = new lib.buble_orangeteam();
					buble.name = "buble";
					if (leftPlayer_tryNum % 2 == 0) { //תהיה החלפה בין המשפטים
						buble.orangeTalk.text = sentences[0]; //לקיחת משפט ממערך מתאים
					} else {
						buble.orangeTalk.text = sentences[1]; //לקיחת משפט ממערך מתאים
					}
		
					stage.addChild(buble);
					//מיקום בועת הדיבור בצד שמאל
					buble.x = 210;
					buble.y = stageH / 2;
		
				} else { //אם היה תור השחקן הימני
					backMusic = createjs.Sound.play("wooSound");
					stage.getChildByName("group_right").gotoAndPlay(2); //הפעלת אנימציה של הצלחה
					tempScale.scaleY -= 1 / Qamount; //ירידה של המד 
					//הוספה של משפט משוב הצלחה בבועת דיבור
					var buble = new lib.buble_blueteam();
					buble.name = "buble";
					if (rightPlayer_tryNum % 2 == 0) { //תהיה החלפה בין המשפטים
						buble.blueTalk.text = sentences[2]; //לקיחת משפט ממערך מתאים
					} else {
						buble.blueTalk.text = sentences[3]; //לקיחת משפט ממערך מתאים
					}
					stage.addChild(buble);
					//מיקום בועת הדיבור עם המשפט בצד ימין
					buble.x = 1145;
					buble.y = stageH / 2;
		
				}
		
		
			} else { //-------------------אם התשובה לא נכונה---------------		
				stage.getChildByName("dis" + currentClick).gotoAndStop(3); //מעבר לפריים המציג מסגרת אדומה למסיח
				
				if (player == "left") {
					stage.getChildByName("group_left").gotoAndPlay(20);//הפעלת אנימציה מתאימה
					leftPlayer_wrongNum++; //העלת מספר השגיאות לשחקן
		
		
				} else {
					stage.getChildByName("group_right").gotoAndPlay(20);//הפעלת אנימציה מתאימה
					rightPlayer_wrongNum++; //העלת מספר השגיאות לשחקן
				}
		
			}
		
			backToDefault(); //פונקציה שהופכת את המסיחים ללא פעילים
			clearInterval(timer); //עצירת הסטופר 
		}
		
		function backToDefault() { //פונקציה שהופכת את המסיחים ללא פעילים
			for (i = 1; i < myGame[qCounter].length; i++) { //לולאה שעוברת על כל המסיחים על הבמה
				stage.getChildByName("dis" + i).removeEventListener('click', clickAnswer); //מבטלת את הקריאה לפונקציה בקליל
				stage.getChildByName("dis" + i).cursor = "default"; //שינוי מראה העכבר ללא לחיץ
			}
		}
		
		function clean() { //----------------פונקציית ניקוי המסך--------------
			//stage.getChildByName("tempScale").visible = false;
		
			stage.removeChild(stage.getChildByName("feedback")); //הסרת הפידבק לא יישאר!!
		
			stage.removeChild(stage.getChildByName("nextBtn")); //הסרת כפתור המשך
		
			stage.removeChild(stage.getChildByName("gray_name")); //הסרת מסגרת אפורה בשם הקבוצה
		
			//איפוס המסיחים
			for (i = 1; i < myGame[qCounter].length; i++) {
				if (myGame[qCounter][i][3] == "added") {
					myGame[qCounter][i][3] = "not added";
				}
			}
		
			//הסרת פרטים של תם הזמן
			stage.removeChild(stage.getChildByName("timeOut_btn"));
			stage.removeChild(stage.getChildByName("left_timeOut"));
			stage.removeChild(stage.getChildByName("right_timeOut"));
		
			//הסרת תמונות התלמידים היושבים בשולחנות
			stage.removeChild(stage.getChildByName("group_left"));
			stage.removeChild(stage.getChildByName("group_right"));
		
			for (i = 1; i < myGame[qCounter].length; i++) { //הסרת כל המסיחים
				stage.removeChild(stage.getChildByName("dis" + i));
			}
		
			if (myGame[qCounter][0][1] != "nopic") { //בדיקה האם הייתה תמונה בשאלה
		
				stage.removeChild(stage.getChildByName("Qpic")); //הסרת התמונה של השאלה
		
			}
			if (currentClick != null) {
				if ((myGame[qCounter][currentClick][1]) == true) { //אם התשובה נכונה הסרתה מהמאגר
					myGame.splice(qCounter, 1);
					stage.removeChild(stage.getChildByName("buble"));
				}
			}
		
			stage.removeChild(stage.getChildByName("timeTxt")); //הסרת הסטופר
			if (player == "left") { //החלפת שחקנים
				player = "right";
				stage.removeChild(stage.getChildByName("leftName_txt")); //הסרת שמות נציגי הקבוצות
			} else {
				player = "left";
				stage.removeChild(stage.getChildByName("rightName_txt")); //הסרת שמות נציגי הקבוצות
			}
		
			if (myGame.length > 0) {
				newQuestion(); //קריאה לפוקנציה שתיצור את השאלה הבאה
			} else {//אם לא נותרו שאלות במאגר יש קריאה לפונציית המשוב המסכם
				endGame();
			}
		}
		
