		function properTime(min, sec) { //פונקציה המקבלת את ערכי הדקות והשניות של שחקן מסויים
			var display = ""; //משתנה מחרוזת ריק שישרשר את הזמן המתאים
			if (min < 10) { //אם מספר הדקות קטן מ10
				display = "0"; //אז תשרשר 0
			}
			display += min.toString() + ":"; //לאחר מכן תציג את מספר הדקות ונקודתיים
			if (sec < 10) { //אם מספר השניות קטן מ10
				display += "0"; //אז תשרשר 0
			}
			display += sec.toString(); //לאחר מכן תציג את מספר השניות
			return display; //תחזיר להדפסה את המחרוזת שהתקבלה
		}
		
